import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './HomePage';
import UserList from './UserList';
import LoginPage from './LoginPage'; // Importando a nova p치gina de login
import Navbar from './Navbar'; // Importando o Navbar

const App = () => {
  return (
    <Router>
      <div>
        <Navbar /> {/* O Navbar ser치 exibido em todas as p치ginas */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<LoginPage />} /> {/* Adicionando a rota de login */}
          <Route path="/users" element={<UserList />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
